import React from 'react';
import { View,Text, StyleSheet } from 'react-native';

const AvatarTab = () => {
    return (
        <View>
            <Text>Avatar Tab</Text>
        </View>
    );
}

const styles = StyleSheet.create({})

export default AvatarTab;
